var game;
var gameLoaded = false;
var createOnLoaded = false;
var this_, hand_arr = [],
    answer_arr = [],
    num = 0
window.onload = function () {
    c.style.visibility = "hidden";
    var gameConfig = {
        type: Phaser.AUTO,
        parent: 'c',
        width: 562,
        height: 1000,
        backgroundColor: 0x000000,
        scene: [playGame]
    };
    game = new Phaser.Game(gameConfig);
}

class playGame extends Phaser.Scene {

    constructor() {
        super("PlayGame");
    }

    preload() {
        if (gameLoaded) {
            return;
        }

        var pic_name = [],
            addFlag = false;

        for (var p1 in assets) {
            if (assets.hasOwnProperty(p1))
                pic_name.push(p1);
        }
        for (var i = 0; i < pic_name.length; i++) {
            this.textures.addBase64(pic_name[i], eval("assets." + pic_name[i]))
        }

        var imageCount = pic_name.length;
        var loadedCount = 0;
        this.textures.on('addtexture', function () {
            loadedCount++;
            if (imageCount == loadedCount) {
                gameLoaded = true;
                if (createOnLoaded) {
                    this.create();
                }
            }
        }, this);
    }

    create() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        this_ = this
        video.play()
        this.bg = this.add.image(0, 0, 'bg1').setOrigin(0,0)
        this.hand()
        install.onclick = function (params) {
            landingPage()
        }
      
        this.resize();
        window.addEventListener("resize", this.resize, false);
    }

    update() {
        if (!gameLoaded) {
            createOnLoaded = true;
            return;
        }
        // console.log(video.currentTime.toFixed(1))
        this.showHand()
        if (video.currentTime.toFixed(1) == 1.6 && num == 0) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.key()
                setTimeout(() => {
                    this.hand.visible = 1
                }, 400);
            }, 500);
            num = 1
        }
        if (answer_arr[0] == 'key') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(0, 0, 'bg2').setOrigin(0,0)
            }, 500);
            answer_arr = []
        }

        if (video.currentTime.toFixed(1) == 5.7 && num == 1) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.axe()
            }, 500);
            num = 2
        }

        if (answer_arr[0] == 'axe') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
                this.bg.destroy()
                this.bg = this.add.image(0, 0, 'bg3').setOrigin(0,0)

            }, 500);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 17.0 && num == 2) {
            c.style.visibility = "visible";
            video.pause()
            setTimeout(() => {
                this.hide()
            }, 500);
            num = 3
        }
        if (answer_arr[0] == 'hide') {
            setTimeout(() => {
                video.play()
                c.style.visibility = 'hidden'
            }, 500);
            answer_arr = []
        }
        if (video.currentTime.toFixed(1) == 22.0 && num == 3) {
            video.onclick = function () {
                landingPage()
            }
            num = 4
        }
       
    }

                                    delay: 100,
                                    duration: 50,

                                    delay: 150,
                                    duration: 50,
                                    onComplete: () => {

                                        this_.i.clearTint()
                                        this_.l.clearTint()
                                        this_.l2.clearTint()

                                    duration: 50,

                                    targets: [a],

                                    delay: 50,
                                    duration: 50,
                                })

                                    targets: [a],
                                    visible: 0,
                                    delay: 100,
                                    duration: 50,

            }

    showDownload() {
        var rect = new Phaser.Geom.Rectangle(0, 0, game.config.width, game.config.height);
        var graphics1 = this.add.graphics({
            fillStyle: {
                color: 0x000000
            }
        });
        graphics1.alpha = 0.2;
        graphics1.setDepth(8);
        graphics1.fillRectShape(rect);
        var win_bg = this.add.image(281, -400, 'nice').setDepth(10)
        var down = this.add.image(281, 620, 'continue').setDepth(10).setScale(0, 0).setInteractive().on('pointerdown', () => {
            landingPage()
        })
        this.tweens.add({
            targets: [win_bg],
            y: 500,
            duration: 800,
            ease: 'Back',
            onComplete: () => {
                this.tweens.add({
                    targets: [down],
                    scaleX: 1,
                    scaleY: 1,
                    duration: 500,
                    onComplete: () => {
                        landingPage()
                        setInterval(() => {
                            this.tweens.add({
                                targets: [down],
                                scaleX: 1.1,
                                scaleY: 1.1,
                                duration: 300,
                                onComplete: () => {
                                    this.tweens.add({
                                        targets: [down],
                                        scaleX: 1,
                                        scaleY: 1,
                                        duration: 300,
                                        onComplete: () => {

                                        }
                                    })
                                }
                            })
                        }, 600);

                    }
                })
            }
        })
    }
    hand() {
        this.hand = this.add.image(-100, 0, 'hand').setDepth(10).setOrigin(0.3, 0.1).setVisible(0)
        setInterval(() => {
            this.tweens.add({
                targets: [this.hand],
                scaleX: 1,
                scaleY: 1,
                duration: 300,
                onComplete: () => {
                    this.tweens.add({
                        targets: [this.hand],
                        scaleX: 1.1,
                        scaleY: 1.1,
                        duration: 300,
                        onComplete: () => {}
                    })
                }
            })
        }, 600);
    }
    showHand() {
        var words_bg = {x:281,y:750}
        if (hand_arr.length == 0) {
            this.hand.x = words_bg.x-80
            this.hand.y = words_bg.y+50
        }
        if (hand_arr[hand_arr.length - 1] == 'k') {
            this.hand.x = words_bg.x+80
            this.hand.y = words_bg.y+50
        }
        if (hand_arr[hand_arr.length - 1] == 'e') {
            this.hand.x = words_bg.x
            this.hand.y = words_bg.y+50
        }


    }
    resize() {
        var canvas = document.querySelector("canvas");
        var windowWidth = window.innerWidth;
        var windowHeight = window.innerHeight;
        var windowRatio = windowWidth / windowHeight;
        var gameRatio = game.config.width / game.config.height;
        if (windowRatio < gameRatio) {
            canvas.style.width = windowWidth + "px";
            canvas.style.height = (windowWidth / gameRatio) + "px";
            v.style.width = windowWidth + "px";
            v.style.height = (windowWidth / gameRatio) + "px";
            c.style.width = windowWidth + "px";
            c.style.height = (windowWidth / gameRatio) + "px";
            mg.style.width = windowWidth + "px";
            mg.style.height = (windowWidth / gameRatio) + "px";
        } else {
            canvas.style.width = (windowHeight * gameRatio) + "px";
            canvas.style.height = windowHeight + "px";
            v.style.width = (windowHeight * gameRatio) + "px";
            v.style.height = windowHeight + "px";
            c.style.width = (windowHeight * gameRatio) + "px";
            c.style.height = windowHeight + "px";
            mg.style.width = (windowHeight * gameRatio) + "px";
            mg.style.height = windowHeight + "px";
        }
    }
